                            text="#TECH"
                        />
                    </Col>
                    <Col> </Col>

                </Row>
                <Row>
                    <Title
                        fontSize="40px"
                        fontWeight="lighter"
                        color="#b2b2b2"
                        text="New thinking. New #tech."
                    /></Row>
            </Container>
        );
    }


}

export default Home;
